import React from "react";
import { useState } from "react";

const Field = () => {
  const [val, setVal] = useState("");
  console.log(val);
  return (
    <input
      type="text"
      value={val}
      onChange={(e) => {
        setVal(e.target.value);
      }}
    />
  );
};

export default Field;
